(214, 'RubenMab', '81788449385', 'voyceh.shpak@enciklopediya.org', 1514560742, 'Сторонники бывшего губернатора Одесской области Украины Михаила Саакашвили, штурмом прорвавшиеся в Октябрьский дворец в Киеве, покинули здание по его просьбе. Об этом сообщает в воскресенье, 17 декабря, «Страна.ua». По данным издания, большая часть активистов после его призыва переместилась к зданию Верховной Рады. \r\n \r\nСам Саакашвили заявил, что не собирался штурмовать дворец. «Не знаю, кто там продолжает пробиваться. Это не Верховная Рада, зачем это насилие! Кто хочет разбивать здания — извините, нам не по пути», — сказал он. \r\n \r\nПо словам бывшего губернатора, произошедшее было провокацией. «Нам сказали, что туда можно пройти и провести мероприятие. А там идет концерт. Нас встретили шашками и газом», — пояснил он. «Я с полной ответственностью заявляю, что никаких планов захвата дворца у нас не было. Никаких планов насильственных действий у нас нет и не было», — подчеркнул Саакашвили. \r\n \r\nПолитик также открестился от тех, кто штурмовал дворец. «Все наши действия против коррупции могут быть только мирными. Я открещиваюсь от любых попыток разбивать окна, захватывать здания и заводить туда насильственно людей», — сказал он, добавив, что провокаторы намеревались дискредитировать мирную акцию. Заместитель главы Нацполиции Вячеслав Аброськин на своей странице в Facebook сообщил, что по факту произошедшего возбуждено уголовное производство. «Все причастные к захвату здания будут установлены. Виновные будут привлечены к ответственности», — написал он. По его информации, в помещении проходил детский праздник. \r\n \r\nПо расписанию в зале Октябрьского дворца во время штурма проходил джазовый концерт Glen Miller Orchestra. В то же время депутат Верховной Рады Украины Антон Геращенко написал в Facebook, что в здании проводится новогодний детский утренник, на котором присутствуют сотни детей и их родителей. \r\n \r\nРанее сообщалось, что сторонники Саакашвили после марша за импичмент президента страны штурмом взяли Октябрьский дворец. Демонстранты выломали входную дверь и подавили сопротивление нацгвардейцев, забаррикадировавшихся внутри. Силовики оборонялись при помощи огнетушителей. В сети появилось видео произошедшего.', 0),
