временно отключена] \r\n(Кнопки телепорта на Анубис NumPad от 0 до 4, Припять NumPad от 5 до 9) \r\n \r\n \r\n<a href=https://kiva-hack.ru/page/warface/energyhack><img src="https://zhack.ru/uploads/monthly_2018_10/5bb65ad8b7de3_kupit-seychas.png.9bf0340f44ce4920411d11ad501d93e4.png"></a> \r\n<a href=https://vk.com/id429531683><img src="https://kiva-hack.ru/img/buy-cheat-vk.png"></a> \r\n \r\n \r\n \r\n#ЧитДляWarface #РабочийЧитДляВарфейс #АнтиотдачаДляВарфейс #ФастАимДляВарфейс #AimForWarface #ЧитыДляВарфейс #АимВарфейсскачатьБесплатноЧитыВарфейс #СкачатьЧитДляВарфейс #АимботДляВарфейс #СкачатьЧитыДляВарфейс #ЛучшийЧитДляВарфейс #ЧитДляЕуВарфейс #ЕспДляВарфейс #АимДляВарфейс \r\n', 0),
