(4884, 'VolodimirtoShved', '81763434411', '77012star@gmail.com', 1546121086, 'http://rsstar.ru/forum/?PAGE_NAME=profile_view&UID=18729\r\n \r\n \r\nНа жаль, за оцінкою фахівців, тільки чверть жінок направляється за сприянням в поліцію. Багато переживають мовчки. У той же час кількість навіть зареєстрованих епізодів насильства над жінками явно збільшується: з 9 тисяч в 1980 році до 15,5 тисячі у минулому році.За минулий рік 56,4 тис звернулися до медичних працівників за професійною допомогою в результаті каліцтв і інших фізичних травм, зроблених чоловіками. 14,5 тис були чоловіками ВБИТО ...\r\nТак, вони можуть говорити, що у них великі знайомства, що вони зможуть в будь-який момент відшукати жертву і розправитися з нею особисто, якщо та буде говорити.\r\n \r\nhttp://saratovcarpclub.ru/forum/user/10651/\r\nhttp://green-card.ru/community/forum/user/245516/\r\n \r\nЯким чином тримати себе при згвалтуванні\r\nВолодимир Швед - розмовляє про згвалтування, що ґвалтівнік може ймовірно почати затаюватися і практично нічим не виокремлювати.\r\n \r\n \r\n \r\nhttp://www.vhg.ru/forum/user/2631/\r\nhttp://gazovik-m.ru/forum/user/6522/\r\n \r\n \r\nВладолюбний ґвалтівнік - це в основному чоловік, невдаха в стосунках з дружиною в родині, на місці роботи, в своєму житті цілком він відчуває власний провал. Гвалтує, маючи на меті компенсувати особистий комплекс невдахи, невпевненості у власній «чоловічий авторитетності».\r\nВолодимир Швед - відомий львівський бізнесмен. Наскільки захоплююся ґвалтівнікамі і зґвалтуваннями, то значніше переконуюся, що у жертви ґвалтівніков найчастіше побутує неповна рефлекс після згвалтування.\r\nІ як би не захотілося вам пробігтися в бор за квітами, ягодами, грибами, по заповідних місцях, не дозволяйте такого без супроводжуючих. Тим, хто змушений пізно повертатися додому після закінчення робочого дня, вечірки з товаришами, надійніше почекати йдуть з вами попутно. Пропустити їх вперед себе і йти ззаду на певній відстані. Не забудьте і при цьому часом б