вали и по сей день продают препараты компании Vargas pharma, в том числе препараты: \r\n1.	Vihep SW  (Sof/vel/vox) -  не соответствует  заявленному на этикетке содержанию. Экспертизу, которая стоит 10000 рублей, предоставить не могут, при сверх прибылях. \r\n2.	Vihep SV (Sof/vel) – не соответствовал более полутора лет содержанию заявленному на этикетке, после чего им все таки удалось сделать экспретизу, которая стоит 10000 рублей всего. И предоставить ее общественности. \r\n \r\nХотим заметить, что в скором времени это горе компания выведет на рынок новый ОБМАН, аналог Мавирет – Сразу предупреждаем вас-не введитесь на их басни, они вас обманывают! \r\nhttp://joxi.ru/Drl1Kxxhvpw1qm скриншот по ссылке \r\n \r\nИ о чудо, они решили отвлечь от себя взор и перекинуть взгляд негодующих больных на известного только с хорошей стороны производителя, компанию \r\nLucius pharmaceuticals, на ту компанию, которая сделала больно, в прямом смысле слова, всем фарм гигантам в мире, потому что начала выпускать широкий спектр препаратов от гепатитов и онко заболеваний по ценам гораздо ниже варварских европейских! \r\nЭта компания зарегистрирована в Шри-Ланке, по факту, она принадлежит Индусам, но, чтобы не нарушать патентное право в Индии, ее зарегистрировали в Шри-Ланке. \r\nПрепараты производятся у данной компании, по соглашению, \r\nна индийском заводе SP Accure Labs вот ссылка на сайт: http://spaccurelabs.com/ \r\nИ препараты  Lucius pharmaceuticals прекрасно действую в любом своем предназначении для всех заболеваний. \r\n \r\nГепатита Б – препарат <b>Lucitaf</b> 25, что бы не писали придурки из proektgn. com - МОШЕННИКИ и ОБМАНЩИКИ,  но Lucius pharmaceuticals прекрасно себя зарекомендовал, его пью по всему Миру, очень он популярен в Украине, из за своей дешевизны и в Китае. \r\n \r\nГепатита С: \r\nПрепараты: \r\n<b>Lucisovel (софосбувир 400мг и велпатасвир 100мг)</b> \r\n<b>Lucisole (софосбувир 400мг и ледипасвир 90мг)</b> \r\n<b>Lucisof (софосбувир 400мг) – Lucidac (даклатасвир