(27, 1, 16, 'ĐỘI NGŨ BÁC SĨ CHUYÊN KHOA THẨM MỸ MŨI BỆNH VIỆN THẨM MỸ KANGNAM', 'DOI-NGU-BAC-SI-CHUYEN-KHOA-THAM-MY-MUI-BENH-VIEN-THAM-MY-KANGNAM-27', '', '<h2>Hiện nay, Bệnh viện thẩm mỹ Kangnam tự h&agrave;o l&agrave; trung t&acirc;m thẩm mỹ uy t&iacute;n h&agrave;ng đầu Việt Nam về c&ocirc;ng nghệ thẩm mỹ mũi. Đến với Kanngnam, bạn sẽ được trải nghiệm sự kh&aacute;c biệt kh&ocirc;ng chỉ ở c&ocirc;ng nghệ thẩm mỹ vượt trội m&agrave; c&ograve;n đội ngũ b&aacute;c sĩ uy t&iacute;n, gi&agrave;u kinh nghiệm đ&atilde; gi&uacute;p cho h&agrave;ng ng&agrave;n kh&aacute;ch h&agrave;ng đạt được kết quả thẩm mỹ mũi ho&agrave;n hảo nhất.</h2>\r\n\r\n<h3>1. Đội ngũ b&aacute;c sĩ c&oacute; tr&igrave;nh độ chuy&ecirc;n m&ocirc;n cao</h3>\r\n\r\n<p>Khoa thẩm mỹ mũi của&nbsp;Bệnh viện thẩm mỹ Kangnam&nbsp;hội tụ đội ngũ c&aacute;c chuy&ecirc;n gia, b&aacute;c sĩ thẩm mỹ mũi giỏi, nhiều kinh nghiệm v&agrave; t&acirc;m huyết với nghề:</p>\r\n\r\n<p><img alt="chang-geun-wook" src="https://benhvienthammykangnam.vn/wp-content/uploads/2016/10/chang-geun-wook.jpg" style="height:295px; width:188px" /><em>Cố vấn chuy&ecirc;n m&ocirc;n,&nbsp;Tiến sĩ Chang Geun Wook</em></p>\r\n\r\n<p><em><strong>&ndash; Cố vấn chuy&ecirc;n m&ocirc;n,</strong>&nbsp;<strong>Tiến sĩ Chang Geun Wook:</strong></em>&nbsp;Tốt nghiệp trường đại học In Ha, Viện trưởng viện phẫu thuật thẩm mỹ mũi Shimmian, Hội vi&ecirc;n ch&iacute;nh thức của hội khoa học chuy&ecirc;n khoa mũi H&agrave;n Quốc, Hội vi&ecirc;n ch&iacute;nh thức của hội b&aacute;c sĩ chuy&ecirc;n khoa thẩm mỹ khu&ocirc;n mặt.</p>\r\n\r\n<p><img alt="chuyen-khoa-tham-my-mui-5" src="https://benhvienthammykangnam.vn/wp-content/uploads/2016/10/chuyen-khoa-tham-my-mui-5.png" style="height:192px; width:600px" /><em>B&aacute;c sĩ phẫu thuật thẩm mỹ&nbsp;mũi&nbsp;tại Kangnam</em></p>\r\n\r\n<p><em><strong>&ndash; B&aacute;c sĩ Felix Trần:</strong>&nbsp;</em>Th&agrave;nh vi&ecirc;n Hiệp hội phẫu thuật thẩm mỹ H&agrave;n Quốc, Tốt nghiệp ĐH Y Th&aacute;i Nguy&ecirc;n,&nbsp;Chuy&ecirc;n khoa cấp I chấn thương chỉnh h&igrave;nh,&nbsp;Chuy&ecirc;n khoa định hướng phẫu thuật tạo h&igrave;nh thẩm mỹ.</p>\r\n\r\n<p><em><strong>&ndash; B&aacute;c sĩ Donald&nbsp;Hưng:&nbsp;</strong></em>B&aacute;c sĩ Đa khoa, Chứng chỉ h&agrave;nh nghề: Kh&aacute;m bệnh, chữa bệnh chuy&ecirc;n khoa Chấn thương chỉnh h&igrave;nh.</p>\r\n\r\n<p><em><strong>&ndash; B&aacute;c sĩ Jose Nguyễn</strong></em>:&nbsp;B&aacute;c sĩ đa khoa Đại học Y Th&aacute;i Nguy&ecirc;n, Chứng chỉ B&aacute;c sĩ chuy&ecirc;n khoa sơ bộ Phẫu thuật tạo h&igrave;nh, B&aacute;c sĩ CKI G&acirc;y m&ecirc; hồi sức.</p>\r\n\r\n<p><em><strong>&ndash; B&aacute;c sĩ Ji-hun Huỳnh:</strong></em>&nbsp;B&aacute;c sĩ Y Đa khoa.</p>\r\n\r\n<p>Đến với dịch vụ thẩm mỹ mũi&nbsp;tại Kangnam, bạn sẽ c&oacute; cơ hội được trực tiếp đội ngũ b&aacute;c sĩ chuy&ecirc;n khoa mũi h&agrave;ng đầu Việt Nam &ndash; H&agrave;n Quốc tư vấn, thăm kh&aacute;m v&agrave; thực hiện. Dưới đ&ocirc;i b&agrave;n tay t&agrave;i hoa, sự kh&eacute;o l&eacute;o, tỉ mỉ ch&iacute;nh x&aacute;c trong từng c&aacute;c thao t&aacute;c thực hiện đ&atilde; mang đến cho hơn 20.000&nbsp;kh&aacute;ch h&agrave;ng chiếc mũi&nbsp;ưng &yacute; nhất.</p>\r\n\r\n<h3>2. B&aacute;c sĩ chuy&ecirc;n khoa mũi Kangnam c&oacute; con mắt thẩm mỹ tinh tế</h3>\r\n\r\n<p><img src="https://nangmuikangnam.com/wp-content/uploads/2017/01/b%C3%A1c-si-kangnam.png" style="height:406px; width:600px" title="Bác sĩ chuyên khoa mũi Kangnam có con mắt thẩm mỹ tinh tế" /><em>B&aacute;c sĩ chuy&ecirc;n khoa mũi Kangnam c&oacute; con mắt thẩm mỹ tinh tế</em></p>\r\n\r\n<p>Kết quả thẩm mỹ mũi&nbsp;c&oacute; tốt hay kh&ocirc;ng được quyết định rất nhiều ở yếu tố b&aacute;c sĩ. Điều n&agrave;y kh&ocirc;ng chỉ đ&ograve;i hỏi đ&ocirc;i b&agrave;n tay kh&eacute;o l&eacute;o, t&agrave;i giỏi m&agrave; c&ograve;n cần đến con mắt thẩm mỹ tinh thế, sự nhạy b&eacute;n của đội ngũ b&aacute;c sĩ.</p>\r\n\r\n<p>Tại bệnh viện thẩm mỹ Kangnam, với bề d&agrave;y kinh nghiệm c&ugrave;ng sự tận t&acirc;m với kh&aacute;ch h&agrave;ng, c&aacute;c b&aacute;c sĩ sẽ&nbsp;ph&acirc;n t&iacute;ch đặc điểm cấu tr&uacute;c mũi, dựa theo d&aacute;ng mũi v&agrave; khu&ocirc;n mặt của kh&aacute;ch h&agrave;ng để&nbsp;tư vấn phương ph&aacute;p chỉnh sửa ph&ugrave; hợp.</p>\r\n\r\n<h3>3. Gi&agrave;u y đức, t&aacute;c phong l&agrave;m việc chuy&ecirc;n nghiệp</h3>\r\n\r\n<p><img src="https://nangmuikangnam.com/wp-content/uploads/2017/01/b%C3%A1c-si-kangnam-5.jpg" style="height:407px; width:600px" title="Bác sĩ tư vấn chế độ chăm sóc sau nâng mũi" /><em>B&aacute;c sĩ tư vấn chế độ chăm s&oacute;c&nbsp;sau n&acirc;ng mũi</em></p>\r\n\r\n<p>Kh&ocirc;ng chỉ giỏi về kỹ thuật chuy&ecirc;n m&ocirc;n, đội ngũ b&aacute;c sĩ thẩm mỹ mũi tại Kangnam c&ograve;n c&oacute; tinh thần tr&aacute;ch nhiệm cao v&agrave; phẩm gi&aacute; y đức cao cả.&nbsp;&nbsp;Trước khi thực hiện bất kỳ dịch vụ thẩm mỹ mũi n&agrave;o b&aacute;c sĩ cũng tư vấn, thăm kh&aacute;m v&agrave; đưa ra những lời khuy&ecirc;n tốt nhất để kh&aacute;ch h&agrave;ng vừa c&oacute; thể l&agrave;m đẹp m&agrave; lại an to&agrave;n tuyệt đối. Đặc biệt, sau quy tr&igrave;nh thực hiện dịch vụ, c&aacute;c b&aacute;c sĩ sẽ theo d&otilde;i tiến tr&igrave;nh hồi phục v&agrave; kết quả thẩm mỹ của kh&aacute;ch h&agrave;ng,&nbsp;giải đ&aacute;p mọi thắc mắc, vấn đề m&agrave; kh&aacute;ch h&agrave;ng quan t&acirc;m.</p>\r\n\r\n<p><iframe frameborder="0" height="315" src="https://www.youtube.com/embed/fAmx1pprmIQ" width="560"></iframe></p>\r\n\r\n<p>Th&aacute;i độ tận t&igrave;nh, chu đ&aacute;o, phong c&aacute;ch l&agrave;m việc chuy&ecirc;n nghiệp, b&agrave;i bản, khoa học của đội ngũ b&aacute;c sĩ Kangnam đ&atilde; được đ&ocirc;ng đảo kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; cao.</p>\r\n\r\n<p>Mọi th&ocirc;ng tin chi tiết kh&aacute;ch h&agrave;ng vui l&ograve;ng li&ecirc;n hệ Tổng đ&agrave;i Kangnam&nbsp;<strong><a href="tel:19006466" id="callme" onclick="ga(''send'', ''event'', ''Phone'', ''Click'', ''Hotline'');" rel="nofollow" target="_blank">1900 6466</a></strong>&nbsp;để được tư vấn v&agrave; giải đ&aacute;p miễn ph&iacute;.</p>\r\n'),
