(41, 1, 26, 'KANGNAM CHI 20 TỶ ĐỒNG LÀM CHƯƠNG TRÌNH TRUYỀN HÌNH THỰC TẾ VỀ THẨM MỸ', 'KANGNAM-CHI-20-TY-DONG-LAM-CHUONG-TRINH-TRUYEN-HINH-THUC-TE-VE-THAM-MY-41', 'Bệnh viện thẩm mỹ Kangnam đầu tư công nghệ hiện đại và mời chuyên gia từ Hàn Quốc, Mỹ tới tư vấn làm đẹp cho thí sinh trong chương trình.\r\n', '<p>Sau th&agrave;nh c&ocirc;ng của 2 m&ugrave;a đầu, H&agrave;nh tr&igrave;nh lột x&aacute;c trở th&agrave;nh nơi trao đi những cơ hội thay đổi ngoại h&igrave;nh cho c&aacute;c bạn trẻ k&eacute;m sắc. Chương tr&igrave;nh do Bệnh viện Thẩm mỹ Kangnam phối hợp với Hiệp hội Thẩm mỹ H&agrave;n Quốc tổ chức.</p>\r\n\r\n<p>Năm nay, Bệnh viện thẩm mỹ Kangnam đầu tư 20 tỷ đồng để thực hiện chương tr&igrave;nh.&ldquo;Ch&uacute;ng t&ocirc;i x&acirc;y dựng H&agrave;nh tr&igrave;nh lột x&aacute;c th&agrave;nh chương tr&igrave;nh truyền h&igrave;nh thực tế về phẫu thuật thẩm mỹ, gồm 12 tập, n&oacute;i về cuộc sống của c&aacute;c bạn trẻ trước v&agrave; sau khi phẫu thuật. Qua đ&oacute;, người xem sẽ c&oacute; c&aacute;i nh&igrave;n to&agrave;n diện, cởi mở về ng&agrave;nh thẩm mỹ&rdquo;, Gi&aacute;o sư Charlie Trần &ndash; Gi&aacute;m đốc chuy&ecirc;n m&ocirc;n Bệnh viện Thẩm mỹ Kangnam cho biết.</p>\r\n\r\n<p><img alt="Hành trình lột xác" src="https://nangmuidep.vn/wp-content/uploads/2018/10/13/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/image001-8789-1539338968.png" style="height:331px; width:500px" title="Giáo sư Charlie Trần - Giám đốc chuyên môn Bệnh viện Thẩm mỹ Kangnam, là một trong bộ ba quyền lực của Hành trình lột xác 2018." /></p>\r\n\r\n<p><em>Gi&aacute;o sư Charlie Trần &ndash; Gi&aacute;m đốc chuy&ecirc;n m&ocirc;n Bệnh viện Thẩm mỹ Kangnam, l&agrave; một trong bộ ba quyền lực của H&agrave;nh tr&igrave;nh lột x&aacute;c 2018.</em></p>\r\n\r\n<p>Bệnh viện thẩm mỹ Kangnam &aacute;p dụng c&aacute;c c&ocirc;ng nghệ hiện đại, được chuyển giao trực tiếp từ c&aacute;c &ldquo;cường quốc&rdquo; phẫu thuật thẩm mỹ tr&ecirc;n thế giới. Đ&oacute; l&agrave; kỹ thuật n&acirc;ng mũi cấu tr&uacute;c 4D, cắt m&iacute; Plasma, thẩm mỹ h&agrave;m mặt V-line, n&acirc;ng ngực Nano, h&uacute;t mỡ Lipo Matic 3D&hellip; để phục vụ th&iacute; sinh.</p>\r\n\r\n<p>Trước mỗi ca phẫu thuật, th&iacute; sinh sẽ xem trước kết quả qua h&igrave;nh ảnh 3D, c&ocirc;ng nghệ thực tế ảo (VR). Hậu phẫu thuật, c&aacute;c chuy&ecirc;n gia sẽ chăm s&oacute;c, theo d&otilde;i sức khỏe cho c&aacute;c bạn bằng hệ thống m&aacute;y hồi sức.</p>\r\n\r\n<p>B&ecirc;n cạnh đội ngũ chuy&ecirc;n gia h&agrave;ng đầu Việt Nam, chương tr&igrave;nh mời Dr. Kang Kyoung-Jin, Chủ tịch Hiệp hội Thẩm mỹ H&agrave;n Quốc, Dr. Robert Peterson, chuy&ecirc;n gia tạo h&igrave;nh v&oacute;c d&aacute;ng đến từ Mỹ tư vấn l&agrave;m đẹp&nbsp; cho th&iacute; sinh.</p>\r\n\r\n<p><img alt="Hành trình lột xác mùa 3" src="https://nangmuidep.vn/wp-content/uploads/2018/10/13/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/image003-6876-1539338968.png" style="height:281px; width:500px" title="Công nghệ dựng hình 3D, công nghệ thực tế ảo được áp dụng nhằm giúp thí sinh xem trước kết quả phẫu thuật" /></p>\r\n\r\n<p><em>C&ocirc;ng nghệ dựng h&igrave;nh 3D, c&ocirc;ng nghệ thực tế ảo được &aacute;p dụng nhằm gi&uacute;p th&iacute; sinh xem trước kết quả phẫu thuật</em></p>\r\n\r\n<p>Dr. Robert Peterson cho biết: &ldquo;Ch&uacute;ng t&ocirc;i kỳ vọng, với sự g&oacute;p mặt của đội ngũ b&aacute;c sĩ thẩm mỹ đến từ nhiều nước, c&ugrave;ng trang thiết bị hiện đại của Bệnh viện thẩm mỹ Kangnam, chương tr&igrave;nh năm nay sẽ mang đến cuộc lột x&aacute;c cho th&iacute; sinh&rdquo;. Lần thứ 3 tham gia chương tr&igrave;nh, Dr. Kang Kyoung-Jin đ&aacute;nh gi&aacute;, H&agrave;nh tr&igrave;nh lột x&aacute;c chứa đựng nhiều &yacute; nghĩa nh&acirc;n văn.</p>\r\n\r\n<p><img alt="Hành trình lột xác kangnam" src="https://nangmuidep.vn/wp-content/uploads/2018/10/13/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/image005-1153-1539338968.png" style="height:281px; width:500px" title="Bệnh viện Thẩm mỹ Kangnam mạnh tay đầu tư trang thiết bị, công nghệ hiện đại nhất để giúp các thí sinh &quot;lột xác&quot; về ngoại hình" /></p>\r\n\r\n<p><em>Bệnh viện Thẩm mỹ Kangnam mạnh tay đầu tư trang thiết bị, c&ocirc;ng nghệ hiện đại nhất để gi&uacute;p c&aacute;c th&iacute; sinh &ldquo;lột x&aacute;c&rdquo; về ngoại h&igrave;nh</em></p>\r\n\r\n<p>Năm nay th&iacute; sinh sẽ đồng h&agrave;nh c&ugrave;ng những người nổi tiếng: diễn vi&ecirc;n Ninh Dương Lan Ngọc, si&ecirc;u mẫu V&otilde; Ho&agrave;ng Yến, MC Ch&uacute;ng t&ocirc;i l&agrave; chiến sĩ Ho&agrave;ng Linh, chuy&ecirc;n vi&ecirc;n trang điểm Qu&aacute;ch &Aacute;nh c&ugrave;ng Huấn luyện vi&ecirc;n h&igrave;nh thể Hana Giang Anh, ca sĩ Đức Ph&uacute;c. D&agrave;n sao sẽ định hướng phong c&aacute;ch thời trang, r&egrave;n luyện th&acirc;n thể, kỹ năng giao tiếp&hellip;</p>\r\n\r\n<p><img alt="Hành trình lột xác bệnh viện kangnam" src="https://nangmuidep.vn/wp-content/uploads/2018/10/13/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/kangnam-chi-20-ty-dong-lam-chuong-trinh-truyen-hinh-thuc-te-ve-tham-my/image011-7740-1539338968.png" style="height:262px; width:500px" title="Chương trình quy tụ đông đảo dàn sao, hứa hẹn sẽ đem tới những tập phim hấp dẫn" /></p>\r\n\r\n<p><em>Chương tr&igrave;nh quy tụ đ&ocirc;ng đảo d&agrave;n sao, hứa hẹn sẽ đem tới những tập phim hấp dẫn</em></p>\r\n\r\n<p>Gi&aacute;o sư Charlie Trần &ndash; Gi&aacute;m đốc chuy&ecirc;n m&ocirc;n Bệnh viện thẩm mỹ Kangnam chia sẻ, H&agrave;nh tr&igrave;nh lột x&aacute;c 2018 vẫn giữ đ&uacute;ng tinh thần nh&acirc;n văn với phương ch&acirc;m &ldquo;Thay đổi ch&acirc;n dung &ndash; Mở lối ước mơ&rdquo;. Chương tr&igrave;nh mong muốn trao cơ hội cho nhiều người trẻ Việt t&agrave;i năng nhưng kh&ocirc;ng may mắn về ngoại h&igrave;nh, ho&agrave;n cảnh kh&oacute; khăn trong cuộc sống.</p>\r\n\r\n<p>&Ocirc;ng cho biết th&ecirc;m, chương tr&igrave;nh sẽ khởi chiếu v&agrave;o l&uacute;c 19h ng&agrave;y 14/10 tr&ecirc;n k&ecirc;nh TodayTV v&agrave; 19h thứ 5 ng&agrave;y 18/10 tr&ecirc;n k&ecirc;nh YouTV, ph&aacute;t lại v&agrave;o l&uacute;c 8h thứ 2 tr&ecirc;n TodayTV v&agrave; 10h30 thứ 6 tr&ecirc;n You TV.</p>\r\n'),
(42, 2, 26, '26', '26-42', '', '');
INSERT INTO `tintuc_lang` (`id`, `idNgonNgu`, `idTinTuc`, `Name`, `Alias`, `Description`, `Content`) VALUES
(43, 1, 27, 'CÁCH NẮN LẠI SỐNG MŨI BỊ LỆCH, VẸO ĐƠN GIẢN CHO MŨI THẲNG SAU 5 PHÚT', 'CACH-NAN-LAI-SONG-MUI-BI-LECH,-VEO-DON-GIAN-CHO-MUI-THANG-SAU-5-PHUT-43', 'Sau nâng mũi, sống mũi của bạn không may bị lệch do va chạm mạnh, do bị thương? Bạn tự ti vì thẩm mỹ mà chiếc mũi lệch xấu xí hơn trước? Vậy mũi bị lệch phải làm sao đây? Hãy cùng khám phá các cách nắn lại mũi lệch ngay tại nhà đơn giản sau đây để sớm lấy lại mũi thẳng chỉ sau 5 phút mỗi ngày sau nhé!', '<h2><strong>1/ C&aacute;ch nắn lại mũi bị lệch với 2 ng&oacute;n tay c&aacute;i</strong></h2>\r\n\r\n<p><img alt="Cách nắn lại sống mũi bị lệch với 2 ngón tay cái" src="https://nangmuidep.vn/wp-content/uploads/nan-lai-song-mui-bi-lech-min.jpg" style="height:288px; width:450px" title="Chỉnh sửa sống mũi bị lệch đơn giản với 2 ngón tay cái" /></p>\r\n\r\n<p><em>Nắn sống mũi bằng hai ng&oacute;n tay c&aacute;i l&agrave; b&agrave;i tập được chuy&ecirc;n gia khuy&ecirc;n n&ecirc;n &aacute;p dụng</em></p>\r\n\r\n<p>+ Với c&aacute;ch n&agrave;y bạn d&ugrave;ng hai ng&oacute;n tay c&aacute;i đặt s&aacute;t hai b&ecirc;n c&aacute;nh mũi, ấn nhẹ sau đ&oacute; từ từ di chuyển từ tr&ecirc;n xuống dưới, dừng lại ở điểm mũi bị lệch l&acirc;u hơn. Ấn xuống đồng thời đẩy nhẹ sống mũi về ph&iacute;a ngược lại.</p>\r\n\r\n<p>+ Để tr&aacute;nh tổn thương cho mũi th&igrave; bạn n&ecirc;n thực hiện nhẹ tay trong lần đầu v&agrave; tăng dần lực cũng như cường độ cho những lần thực hiện sau.</p>\r\n\r\n<p>+ Bạn chỉ n&ecirc;n l&agrave;m 3 &ndash; 4 lần mỗi ng&agrave;y, thời gian 10 &ndash; 15 ph&uacute;t, kh&ocirc;ng n&ecirc;n lạm dụng tr&aacute;nh sụn n&acirc;ng mũi bị lệch g&acirc;y đau nhức, c&oacute; thể chảy m&aacute;u nếu qu&aacute; mạnh tay.</p>\r\n\r\n<h2><strong>2/ Nắn lại sống mũi bị lệch bằng ng&oacute;n trỏ v&agrave; ng&oacute;n c&aacute;i</strong></h2>\r\n\r\n<p><img alt="Nắn lại sống mũi bị lệch đơn giản với ngón trỏ và ngón cái" src="https://nangmuidep.vn/wp-content/uploads/nan-lai-song-mui-bi-lech4-1.jpg" style="height:282px; width:450px" title="Nắn lại sống mũi bị lệch đơn giản với ngón trỏ và ngón cái" /></p>\r\n\r\n<p><em>N&ecirc;n thực hiện nhẹ nh&agrave;ng để tr&aacute;nh g&acirc;y tổn thương cho mũi</em></p>\r\n\r\n<p>B&agrave;i tập nắn lại sống mũi bị lệch n&agrave;y gồm 3 bước đơn giản sau đ&acirc;y:</p>\r\n\r\n<p><strong>+ Bước 1:&nbsp;</strong>D&ugrave;ng ng&oacute;n tay c&aacute;i v&agrave; tay trỏ của b&agrave;n tay thuận, đặt l&ecirc;n v&ugrave;ng sống mũi gần hốc mắt.</p>\r\n\r\n<p><strong>+ Bước 2:</strong>&nbsp;Vuốt nhẹ từ sống mũi xuống đầu mũi, nắn dọc suốt để sống mũi thẳng</p>\r\n\r\n<p><strong>+ Bước 3:</strong>&nbsp;Tại điểm sống mũi bị lệch d&ugrave;ng tay đẩy nhẹ về hướng ngược lại.</p>\r\n\r\n<p>Với c&aacute;ch n&agrave;y h&atilde;y thực hiện 10 &ndash; 15 lần một nhịp sau đ&oacute; nghỉ 5 gi&acirc;y v&agrave; tiếp tục thực hiện 3 &ndash; 4 hiệp. Mỗi ng&agrave;y bạn h&atilde;y l&agrave;m 2 &ndash; 3 lần như vậy, sau 1 thời gian sống mũi kh&ocirc;ng những thẳng m&agrave; c&ograve;n thon hơn.</p>\r\n\r\n<h2><strong>3/ Nắn lại sống mũi bị lệch bằng 10 đầu ng&oacute;n tay</strong></h2>\r\n\r\n<p><img alt="Mũi bị lệch sau nâng sẽ được khắc phục hoàn toàn với 10 ngón tay" src="https://nangmuidep.vn/wp-content/uploads/nan-lai-song-mui-bi-lech3-min.jpg" style="height:518px; width:450px" title="Mũi bị lệch sau nâng sẽ được khắc phục hoàn toàn với 10 ngón tay" /></p>\r\n\r\n<p><em>Thực tế cho thấy những người t&iacute;ch cực nắn vuốt th&igrave; sống mũi bị lệch được cải thiện đ&aacute;ng kể</em></p>\r\n\r\n<p><strong>C&aacute;c bước thực hiện như sau:</strong></p>\r\n\r\n<p><strong>&ndash;&nbsp;Bước 1:&nbsp;</strong>Đặt ng&oacute;n tay c&aacute;i xuống cằm, tại xương quai h&agrave;m. Hai ng&oacute;n tay trỏ đặt từ đu&ocirc;i l&ocirc;ng m&agrave;y dọc theo chiều d&agrave;i của gương mặt.</p>\r\n\r\n<p><strong>&ndash;&nbsp;Bước 2:</strong>&nbsp;C&aacute;c đầu ng&oacute;n tay c&ograve;n lại đặt tr&ecirc;n sống mũi</p>\r\n\r\n<p><strong>&ndash;&nbsp;Bước 3:&nbsp;</strong>Từ từ nắn nhẹ, chuyển dịch từ tr&ecirc;n xuống dưới</p>\r\n\r\n<p>Thực hiện trong khoảng 10 &ndash; 15 ph&uacute;t, tần suất 3 &ndash; 4 lần/ ng&agrave;y. N&ecirc;n thực hiện nhẹ nh&agrave;ng để tr&aacute;nh g&acirc;y tổn thương cho mũi. Thực hiện đều đặn mỗi ng&agrave;y bạn sẽ thấy bất ngờ với kết quả m&agrave; c&aacute;ch n&agrave;y mang lại.</p>\r\n\r\n<p><strong>BẠN GẶP KH&Oacute; KHĂN TRONG QU&Aacute; TR&Igrave;NH NẮN LẠI SỐNG MŨI BỊ LỆCH.</strong></p>\r\n\r\n<p><strong>H&Atilde;Y ĐỂ C&Aacute;C CHUY&Ecirc;N GIA GI&Uacute;P BẠN!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="tich" src="https://nangmuidep.vn/media/images/dang-ky-tu-van.png" style="height:58px; width:239px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>4/ B&agrave;i tập đẩy sống mũi bị lệch sau n&acirc;ng hiệu quả</strong></h2>\r\n\r\n<p><img alt="Chuyên gia chia sẻ cách đẩy mũi khắc phục mũi lệch hiệu quả" src="https://nangmuidep.vn/wp-content/uploads/nan-lai-song-mui-bi-lech5-1.jpg" style="height:300px; width:450px" title="Chuyên gia chia sẻ cách đẩy mũi khắc phục mũi lệch hiệu quả" /></p>\r\n\r\n<p><em>B&agrave;i tập đẩy sống mũi khắc phục khuyết điểm sống mũi bị lệch sau phẫu thuật</em></p>\r\n\r\n<p>C&oacute; kh&ocirc;ng &iacute;t trường hợp mũi bị lệch sau n&acirc;ng do chọn địa chỉ thẩm mỹ kh&ocirc;ng uy t&iacute;n, tay nghề phẫu thuật của b&aacute;c sĩ c&ograve;n yếu k&eacute;m, hay do chế độ chăm s&oacute;c mũi sau n&acirc;ng kh&ocirc;ng đảm bảo. Theo b&aacute;c sĩ Kobee Trần &ndash; Chuy&ecirc;n gia thẩm mỹ mũi tại Bệnh viện Thẩm mỹ Kangnam với những trường hợp n&agrave;y c&oacute; thể điều chỉnh lại sống mũi bằng b&agrave;i tập đơn giản dưới đ&acirc;y:</p>\r\n\r\n<p>+ Bạn d&ugrave;ng hai đầu ng&oacute;n tay trỏ v&agrave; vuốt nhẹ nh&agrave;ng dọc theo v&ugrave;ng sống mũi, vừa vuốt vừa kết hợp một lực nhẹ nh&agrave;ng để nắn chỉnh lại sống mũi sao cho thẳng.</p>\r\n\r\n<p>+ Với b&agrave;i tập n&agrave;y để đạt được hiệu quả th&igrave; n&ecirc;n thực hiện đều đặn 5 &ndash; 10 ph&uacute;t mỗi ng&agrave;y.</p>\r\n\r\n<h2><strong>5/ C&aacute;ch khắc phục sống mũi bị lệch hiệu quả nhất!</strong></h2>\r\n\r\n<p>Tuy nhi&ecirc;n b&aacute;c sĩ Charlie Trần cũng khuyến c&aacute;o mọi người mũi sau n&acirc;ng gặp phải t&igrave;nh trạng n&agrave;y th&igrave; n&ecirc;n đến ngay b&aacute;c sĩ thăm kh&aacute;m để c&oacute; biện ph&aacute;p xử l&yacute; th&iacute;ch hợp nhất, tr&aacute;nh g&acirc;y tổn thương v&agrave; biến chứng cho mũi. B&ecirc;n cạnh đ&oacute; b&aacute;c sĩ cũng cho biết th&ecirc;m việc &aacute;p dụng c&aacute;c b&agrave;i tập tay kể tr&ecirc;n chỉ c&oacute; t&aacute;c dụng với trường hợp mũi lệch nhẹ, c&ograve;n với mũi bị nặng hơn hoặc bị vẹo lệch bẩm sinh th&igrave; sẽ kh&ocirc;ng hề c&oacute; t&aacute;c dụng m&agrave; cần phải phẫu thuật thẩm mỹ để chỉnh sửa.</p>\r\n\r\n<p><img alt="nang mui" src="https://nangmuidep.vn/wp-content/uploads/2018/06/15/mui-xinh-du-xuan-voi-cach-lam-mui-cao-trong-5-phut/mui-xinh-du-xuan-voi-cach-lam-mui-cao-trong-5-phut/nang-mui.jpg" style="height:296px; width:450px" /></p>\r\n\r\n<p><em>Với sống mũi bị lệch sau n&acirc;ng n&ecirc;n thăm kh&aacute;m b&aacute;c sĩ ngay để c&oacute; biện ph&aacute;p xử l&yacute; kịp thời</em></p>\r\n\r\n<p>Hiện nay tại Bệnh viện Thẩm mỹ Kangnam đang ứng dụng rất nhiều c&ocirc;ng nghệ&nbsp;<a href="https://nangmuidep.vn/" target="_blank">thẩm mỹ mũi</a>&nbsp;được chuyển giao trực tiếp từ H&agrave;n Quốc v&agrave; được thực hiện bởi đội ngũ chuy&ecirc;n gia đầu ng&agrave;nh, b&aacute;c sĩ gi&agrave;u kinh nghiệm. Do vậy m&agrave; với trường hợp mũi lệch vẹo b&aacute;c sĩ sẽ tiến h&agrave;nh thăm kh&aacute;m trước để x&aacute;c định nguy&ecirc;n nh&acirc;n mũi bị lệch vẹo l&agrave; do đ&acirc;u, sau đ&oacute; mới đưa ra phương ph&aacute;p chỉnh sửa mũi ph&ugrave; hợp để vừa đảm bảo an to&agrave;n vừa cho kết quả thẩm mỹ như &yacute;.</p>\r\n\r\n<p>Đặc biệt khi sửa mũi lệch vẹo tại Kangnam bằng bất kỳ dịch vụ n&agrave;o th&igrave; kh&aacute;ch h&agrave;ng cũng đều được cấp thẻ bảo h&agrave;nh kết quả thẩm mỹ l&acirc;u d&agrave;i, do đ&oacute; m&agrave; kh&aacute;ch h&agrave;ng lu&ocirc;n cảm thấy tin tưởng v&agrave; h&agrave;i l&ograve;ng khi n&acirc;ng mũi tại đ&acirc;y.</p>\r\n\r\n<p><img alt="Hình ảnh trước sau chỉnh sửa mũi bị lệch bằng công nghệ nâng mũi s line tại Kangnam" src="https://nangmuidep.vn/wp-content/uploads/mui-lech-veo.png" style="height:248px; width:500px" title="Hình ảnh trước sau chỉnh sửa mũi bị lệch bằng công nghệ nâng mũi s line tại Kangnam" /></p>\r\n\r\n<p><em>Kết quả kh&aacute;ch h&agrave;ng sửa mũi lệch vẹo tại Kangnam</em></p>\r\n\r\n<p>Bạn mong muốn chỉnh sửa mũi lệch vẹo an to&agrave;n v&agrave; đẹp tự nhi&ecirc;n. Đừng chần chừ m&agrave; h&atilde;y li&ecirc;n hệ ngay với ch&uacute;ng t&ocirc;i để được c&aacute;c chuy&ecirc;n gia h&agrave;ng đầu tư vấn!</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(44, 2, 27, '27', '27-44', '', '');
